import styled from "styled-components";

const ImageContainer = styled.div`
  img {
    width: 100%;
    height: 10rem;
    object-position: 15% 75%;
    object-fit: cover;
    border-top-left-radius: 0.2rem;
    border-top-right-radius: 0.2rem;
  }
`;

export default ImageContainer;
